-- ----------------------------
-- Table structure for borrow_info
-- ----------------------------
DROP TABLE IF EXISTS `borrow_info`;
CREATE TABLE `borrow_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `package` varchar(20) NOT NULL DEFAULT '' COMMENT '资产包编号',
  `classify` varchar(50) NOT NULL DEFAULT '' COMMENT 'P2B项目主营类型',
  `borrow_name` varchar(50) NOT NULL DEFAULT '' COMMENT '标名',
  `borrow_order` varchar(255) NOT NULL COMMENT '借款编号',
  `borrow_uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '借款人id',
  `borrow_type` tinyint(3) unsigned NOT NULL DEFAULT '3' COMMENT '借款类型:(1 : p2p; 3 : P2B)',
  `duration` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '借款周期',
  `duration_unit` varchar(10) NOT NULL DEFAULT '个月' COMMENT '期限单位',
  `duration_month` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '期限月数',
  `duration_original` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '原始期限（针对于贷款方）',
  `money` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '借款总金额',
  `invest_money` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实投金额',
  `interest` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '借款总利息',
  `finial_money` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '最终投标金额',
  `finial_interest` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '最终利息',
  `finial_base_interest` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '最终应收总利息（针对贷款方）',
  `receive_money` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '实还本金',
  `receive_interest` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实还利息',
  `interest_rate` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '年化率',
  `base_rate` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '基础利率（针对于贷款方）',
  `als_rate` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '平台补贴利率(仅做显示用)',
  `repayment_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '1每月付息，2等额本息',
  `repayment_day` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '每月固定还款日期',
  `borrow_status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '标状态:0:待审核 1:审核未通过 2:审核通过 3:投标完成还款中 4:还款全部完成 5:流标',
  `cover` varchar(255) NOT NULL DEFAULT '' COMMENT '标的封面图片',
  `start_price` decimal(15,2) unsigned NOT NULL DEFAULT '100.00' COMMENT '起投金额',
  `upper_price` decimal(15,2) NOT NULL COMMENT '标金额上限',
  `per_price` decimal(15,2) unsigned NOT NULL DEFAULT '100.00' COMMENT '每份投资额',
  `start_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '资产包开始时间',
  `has_money` decimal(15,2) DEFAULT '0.00' COMMENT '已投金额',
  `open_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '项目开始投资时间',
  `end_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '投资截止时间',
  `full_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '满标时间',
  `deadline` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '还款全部完成时间',
  `is_show` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否显示标：0隐藏，1显示',
  `is_auto` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否可自动投资：0否，1是',
  `is_overdue` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否逾期0:否，1:是，2:逾期结束',
  `is_loan` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0|未申请放款，1|已申请放款',
  `coupons_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '可使用的红包类型：0|不能使用',
  `hits` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `risk` text COMMENT '风险控制',
  `danbao_name` varchar(50) NOT NULL DEFAULT '' COMMENT '担保人名称',
  `zhaiwu_name` varchar(50) NOT NULL DEFAULT '' COMMENT '债务人名称',
  `zhaiwu_idcard` varchar(50) NOT NULL DEFAULT '' COMMENT '债务人身份证',
  `zhaiwu_company` varchar(50) NOT NULL DEFAULT '' COMMENT '债务人企业编号',
  `pact_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '合同类型：1融资租赁，2融资担保',
  `pact_zhang` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '合同章：1上海锦轩融资租赁有限公司',
  `rongziyongtu` text COMMENT '融资用途',
  `sale_auto` tinyint(1) NOT NULL DEFAULT '0',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `type_list` (`borrow_type`,`is_show`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=182 DEFAULT CHARSET=utf8 COMMENT='所有标列表';

-- ----------------------------
-- Records of borrow_info
-- ----------------------------

-- ----------------------------
-- Table structure for borrow_invest
-- ----------------------------
DROP TABLE IF EXISTS `borrow_invest`;
CREATE TABLE `borrow_invest` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `bid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '标的ID',
  `debt_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '债权转让子标id，0:非债权转让',
  `uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '投资用户id',
  `capital` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '投标金额',
  `capital_year` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '年化投资额',
  `interest` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '投资利息总额',
  `fee` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '投资者管理费(利息管理费)总数',
  `receive_capital` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '已返还投资额(本金)',
  `receive_interest` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '已返还利息(扣除管理费后)',
  `paid_fee` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '已收手续费(invest_fee)',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1|预约中的投资,2|竞标中的投资,3|还款中的投资,4|还完的投资,5|取消的投资',
  `deal_status` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '回调处理状态：1|处理中，2|已处理',
  `discount` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '投资折让金（用于债权转让）',
  `order_no` varchar(32) NOT NULL DEFAULT '' COMMENT '订单号',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '投资时间',
  `add_ms` smallint(4) unsigned zerofill NOT NULL DEFAULT '0000' COMMENT '毫秒',
  `deadline` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后一期还款时间',
  `is_auto` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '是否自动投资1:是2:否',
  `client` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1:web,2:android,3:ios,4:wap,5:weixin,6移动',
  `service_id` int(11) DEFAULT '0',
  `sale` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '投标抵扣金（红包抵用）',
  `job_num` varchar(10) NOT NULL DEFAULT '' COMMENT '佣金所有者工号,关联als_admin表',
  `brokerage` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '佣金',
  `brokerage_ext` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '奖金',
  `brokerage_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '佣金类型：1早期佣金数据,2推广用户,3自拓用户',
  `is_first` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否首投：1|是，0|否',
  `rate` decimal(5,2) DEFAULT '0.00' COMMENT '体验表利率，正常标为0',
  `is_beyond` int(3) unsigned DEFAULT '0' COMMENT '是否超投自动投资1:是',
  `add_ip` char(15) DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `investor_uid` (`uid`,`status`) USING BTREE,
  KEY `borrow_id` (`bid`,`uid`,`status`) USING BTREE,
  KEY `investor_uid2` (`uid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1220 DEFAULT CHARSET=utf8 COMMENT='投资记录表';

-- ----------------------------
-- Records of borrow_invest
-- ----------------------------

-- ----------------------------
-- Table structure for members
-- ----------------------------
DROP TABLE IF EXISTS `members`;
CREATE TABLE `members` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_name` varchar(50) NOT NULL DEFAULT '' COMMENT '账号',
  `nick_name` varchar(50) NOT NULL DEFAULT '' COMMENT '昵称（中文、英文、数字）',
  `real_name` varchar(50) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `user_pass` char(32) NOT NULL DEFAULT '' COMMENT '登陆密码',
  `deal_pass` char(32) NOT NULL DEFAULT '' COMMENT '交易密码',
  `app_deal_pass` varchar(10) NOT NULL DEFAULT '' COMMENT '移动端交易密码',
  `user_email` varchar(50) NOT NULL DEFAULT '' COMMENT '用户邮箱',
  `user_phone` varchar(11) NOT NULL DEFAULT '' COMMENT '手机号',
  `user_age` tinyint(1) DEFAULT NULL COMMENT '用户年龄',
  `user_idcard` varchar(30) NOT NULL DEFAULT '' COMMENT '用户证件号',
  `user_idcard_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '用户证件类型',
  `user_growth` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户成长值',
  `user_integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '积分',
  `user_experience` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否投资过体验标\r\n1:已投\r\n0：未投',
  `user_novice` tinyint(1) DEFAULT '0' COMMENT '新手标1：已投，0:未投',
  `user_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1:普通用户,2:学生,3:企业账号,4:非大陆用户',
  `user_head` varchar(255) NOT NULL DEFAULT '' COMMENT '用户头像',
  `vip_level` tinyint(3) NOT NULL DEFAULT '0' COMMENT 'vip等级',
  `vip_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'vip期限',
  `bbs_level_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '论坛等级',
  `bbs_exp` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '论坛经验值',
  `account_money` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '用户余额，用于非精确统计，业务计算需通过接口获取余额',
  `receive_money` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '回款池',
  `recommend` varchar(20) NOT NULL DEFAULT '' COMMENT '推荐人编号,会员为jc000,线下销售为lsf000格式',
  `friend_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '推荐好友ID',
  `id_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '开户状态：0|未开户，1|已开户，2|已实名，3|已绑定手机',
  `email_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '邮箱验证0:未验证,1:通过',
  `account_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态：0正常，1冻结',
  `weixin_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否绑定微信',
  `question_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '安全问题状态：0未设置1已设置',
  `client` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '注册方式0:老平台导入,1:web,2:android,3:ios,4:wap...见client_type.php',
  `service_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '客服id(关联lzh_admin的id)',
  `investment_adviser_id` int(10) NOT NULL DEFAULT '0' COMMENT '投资顾问id(关联admin表id)',
  `qq_id` varchar(255) NOT NULL DEFAULT '' COMMENT 'QQ的open_id',
  `wx_id` varchar(255) NOT NULL DEFAULT '' COMMENT '微信的open_id',
  `login_protect` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否开启登录保护 1开启，0不开启',
  `login_error_num` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '登录错误次数，大于6次就需要手工解冻',
  `login_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '成功登录次数',
  `member_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '客服状态0默认1新客户2意向客户3潜在客户4成交客户5无效客户6无效号码',
  `last_time` int(10) NOT NULL COMMENT '最后通话时间',
  `sina_passwd` tinyint(1) DEFAULT '0' COMMENT '设置新浪交易密码',
  `invest_num` int(10) DEFAULT '0',
  `gesture` varchar(9) DEFAULT '',
  `Advertisement` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0代表不是广告，1是广告进入',
  PRIMARY KEY (`id`),
  KEY `user_type` (`user_type`) USING BTREE,
  KEY `user_integral` (`user_integral`) USING BTREE,
  KEY `user_phone` (`user_phone`) USING BTREE,
  KEY `user_name` (`user_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=37647 DEFAULT CHARSET=utf8 COMMENT='会员表';

-- ----------------------------
-- Records of members
-- ----------------------------

