DROP TABLE IF EXISTS `permission`;
CREATE TABLE `permission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT NULL COMMENT '父id',
  `label` varchar(45) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '标题',
  `path` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '路径',
  `icon` varchar(45) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '图标',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态（1、启用，0、禁用）',
  `link` varchar(45) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '链接地址',
  `is_menu` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否是菜单',
  `lv` int(11) NOT NULL DEFAULT '1' COMMENT '深度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=153 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

